import forms from "./formEntrance.json";

export function getName() {
  return forms.map((form) => {
    return (
      <form>
        <label for={form.id}> {form.name} </label>
        <br></br>
        <input
          type={form.type}
          placeholder={form.placeholder}
          id={form.id}
          name={form.name}
        />
        form[id='5'].option.map((item)=>{
        <select id={form.id} name={form.name}>
          <option value={form.value}>{}</option>
          <option value={form.value}>{}</option>
          <option value={form.value}>{}</option>
        </select>
        })
      </form>
    );
  });
}
